complete_model_interaction.output:
Let's analyze the task step by step to construct a cognitive model of responder behavior based on the provided dataset:

1. **Key Psychological Mechanisms Involved**:
   - **Equity and Fairness**: Responders often weigh the fairness of the offer presented relative to their own contributions and those of their opponents.
   - **Self vs. Opponent Contribution**: The responder may consider their tokens (token_self) alongside the opponent's tokens (token_opp) when evaluating the equity of the proposed split.
   - **Subjective Value of Offers**: The dollar amounts proposed (split_self and split_opp) are converted into perceived fairness which impacts acceptance.

2. **Mechanisms Interaction**:
   - The perceptions stemming from the contributions (token_self, token_opp) could be influenced by the proposed values (split_self, split_opp). A higher contribution may lead to higher acceptance of offers even if the split is not strictly equal.
   - The balance between self-interest and fairness considerations could be represented as a trade-off in the utility function.

3. **Mathematical Form**:
   - A linear model can compactly capture the interaction between fairness and self-interest. The utility for accepting an offer can be formulated as:
   \( U = α \cdot split_self + β \cdot (split_opp - fairness_adjustment) \)
   - Here, fairness_adjustment can be modeled as the discrepancy between self and opponent contributions.

4. **Parameters needed**:
   - **Learnable Parameters**:
     - \( α \) (scale for the acceptance value corresponding to the self-offer) must reflect the importance given to one's own proposed share.
     - \( β \) (scale for the opponent's offer) must indicate how much the responder values the opponent's proposed share relative to reducing perceived inequity.
   -  Both parameters should be bounded to reflect that utility cannot be influenced beyond a certain limit in terms of fairness perception:
     - \(0 < α ≤ 1\)
     - \(0 < β ≤ 1\)

5. **Model Variables Mapping to Behavior**:
   - The values \( split_self \) and \( split_opp \) directly relate to the proposed monetary values.
   - The contributions (token_self and token_opp) influence how equitable the responder perceives the situation, directly inputting into their utility decision-making.

Putting this all together, we can define our model:

<MODEL>
U = α * split_self + β * (split_opp - (0.5 * (token_opp - token_self)))
</MODEL>

