A utility model predicting responder behavior based on proposed offers, incorporating self-interest and perceived fairness relative to both participants' contributions. The model has two learnable parameters: α for the self-offer and β for the opponent's offer, both constrained between 0 and 1. The utility is based on proposed shares adjusted for contribution discrepancies, allowing for nuanced acceptance behaviors in opportunistic contexts.
